import { Box, Grid } from "@material-ui/core";
import React from "react";
import Form from "./form";
import Detail from "./detail";

function ContactUs() {
    return (
        <>
            <Grid container spacing={1}>
                <Grid>
                    <Form />
                </Grid>
                <Grid>
                    <Detail />
                </Grid>
            </Grid>

        </>
    );
}

export default ContactUs;
